-- Миграция таблиц с ивентами! Не забудь внести эту миграцию в ченджлог!

create table event_name
(
    id       bigint generated by default as identity
        primary key,
    title    varchar,
    venue_id bigint
);

alter table event_name
    owner to postgres;







create table event_name_directory
(
    id            bigint generated by default as identity
        primary key,
    event_id      bigint,
    title         varchar,
    event_name_id bigint
);

alter table event_name_directory
    owner to postgres;

